import React, { useEffect, useState } from "react";
import io from "socket.io-client";

const socket = io("http://localhost:5000");

const AdminDashboard = () => {
  const [userData, setUserData] = useState([]);

  useEffect(() => {
    socket.on("updateAdmin", (data) => {
      setUserData(data);
    });

    return () => {
      socket.off("updateAdmin");
    };
  }, []);

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold">ðŸ“Š Admin Panel - User Activity</h1>
      <table className="table-auto w-full border-collapse border border-gray-300 mt-4">
        <thead>
          <tr className="bg-gray-200">
            <th className="border border-gray-300 p-2">User ID</th>
            <th className="border border-gray-300 p-2">Action</th>
            <th className="border border-gray-300 p-2">Timestamp</th>
          </tr>
        </thead>
        <tbody>
          {userData.map((activity, index) => (
            <tr key={index} className="text-center">
              <td className="border border-gray-300 p-2">{activity.userId}</td>
              <td className="border border-gray-300 p-2">{activity.element}</td>
              <td className="border border-gray-300 p-2">{new Date(activity.timestamp).toLocaleString()}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AdminDashboard;
